import{_ as r,c as a,o as c,a2 as i,j as t}from"./chunks/framework.4_bZ6nyl.js";const n=JSON.parse('{"title":"2018.03.24 @學甲 路樹百K之旅[假日騎士日誌]","description":"","frontmatter":{"title":"2018.03.24 @學甲 路樹百K之旅[假日騎士日誌]","date":"2018-03-24T01:51:33.000Z","categories":["假日騎士日誌"]},"headers":[],"relativePath":"Bike/BikeTravel/20180324_學甲_路樹百K之旅.md","filePath":"Bike/BikeTravel/20180324_學甲_路樹百K之旅.md"}'),e={name:"Bike/BikeTravel/20180324_學甲_路樹百K之旅.md"},s=i('<p><a href="https://www.strava.com/activities/1472429043" target="_blank"><img src="https://farm1.staticflickr.com/785/40998352522_2947941956.jpg"></a><br> 上週回來在找資料整理照片的時候<br> 發現學甲除了蜀葵花，附近有幾個景點<br> 主要是木棉花，在將軍國中和華宗橋附近</p><p>看地圖先走將軍國中，再去學甲比較順路<br> 在路途上就看到滿滿的小麥田<br><img src="https://farm1.staticflickr.com/783/27177977148_821b991d48.jpg" alt=""><br><img src="https://farm1.staticflickr.com/789/26178790687_50e23db225.jpg" alt=""><br> 後來到將軍國中，前面有兩排木棉花道<br> 可惜旁邊有排水溝，散發著惡臭及零星垃圾<br><img src="https://farm1.staticflickr.com/896/27177955588_d28694faf7.jpg" alt=""><br><img src="https://farm1.staticflickr.com/790/39240733960_6089da4f79.jpg" alt=""><br><img src="https://farm1.staticflickr.com/784/40156515485_89898e6ba4.jpg" alt=""><br><img src="https://farm1.staticflickr.com/796/27177914408_bec9ce8a80.jpg" alt=""><br> 拍了幾張就往下個目標&quot;苓子寮木棉花道&quot;</p><p>這邊路比較小條，比較多人在拍照<br> 而且路口應該是義工在交通指揮<br> 不過人多，也不喜歡擋住別人的拍照<br><img src="https://farm1.staticflickr.com/901/27177906888_2f9aee918a.jpg" alt=""><br><img src="https://farm1.staticflickr.com/816/40156470265_46960d973c.jpg" alt=""><br><img src="https://farm1.staticflickr.com/888/40156462585_f791a5879e.jpg" alt=""><br><img src="https://farm1.staticflickr.com/820/40341018984_319d245b3d.jpg" alt=""><br><img src="https://farm1.staticflickr.com/790/26178699497_d0d9bbc49f.jpg" alt=""><br><img src="https://farm1.staticflickr.com/801/26178682027_a8355c1cb7.jpg" alt=""></p><p>接著繼續趕最後一個景點&quot;小葉欖仁隧道&quot;<br> 小葉欖仁感覺像是一般常見的路樹<br> 印象中台19線沿路都有小葉欖仁的影子<br> 也趕緊抓住沒有車子的時候跑路中央拍照<br><img src="https://farm1.staticflickr.com/796/26178673497_065b8494ae.jpg" alt=""><br><img src="https://farm1.staticflickr.com/794/41049217811_4aa20b8ae3.jpg" alt=""><br><img src="https://farm1.staticflickr.com/900/41049172061_df46dcc92e.jpg" alt=""><br> 覺得小葉欖仁的綠色很清翠，也是很有生命力<br><img src="https://farm1.staticflickr.com/884/41049161451_445067a5e3.jpg" alt=""><br><img src="https://farm1.staticflickr.com/895/41007605482_af537c02ff.jpg" alt=""><br><img src="https://farm1.staticflickr.com/812/41007601622_6e5bfd8037.jpg" alt=""><br><img src="https://farm1.staticflickr.com/814/40156348585_12e26ff72c.jpg" alt=""><br> 後來發現旁邊是鐵工廠和一些加工區<br> 有些異味冒出來，也就趕緊走了</p><p>上班的時候，看到波斯菊還是忍不住拍一下<br> 覺得波斯菊很多顏色，搭配天空顏色很美<br><img src="https://farm1.staticflickr.com/784/41049133771_a61bec839a.jpg" alt=""><br><img src="https://farm1.staticflickr.com/881/27177751648_caf2327dc1.jpg" alt=""><br><img src="https://farm1.staticflickr.com/889/27177747908_4099aedc8d.jpg" alt=""><br><img src="https://farm1.staticflickr.com/822/40340926784_631490467a.jpg" alt=""><br><img src="https://farm1.staticflickr.com/810/26178560147_10ac02c45f.jpg" alt=""><br><img src="https://farm1.staticflickr.com/813/26178554327_bf35d20f5a.jpg" alt=""></p><h2 id="本週心得" tabindex="-1">#本週心得 <a class="header-anchor" href="#本週心得" aria-label="Permalink to &quot;#本週心得&quot;">​</a></h2><h2 id="_1-目前最舒適踏頻大約95-110" tabindex="-1">1.目前最舒適踏頻大約95~110 <a class="header-anchor" href="#_1-目前最舒適踏頻大約95-110" aria-label="Permalink to &quot;1.目前最舒適踏頻大約95~110&quot;">​</a></h2><p>這次在騎有特別注意一下自己的踏頻<br> 發現維持100左右是比較舒服的頻率<br> 順風的話，大約可以往上到110左右</p><h2 id="_2-爬坡不一定要抽車" tabindex="-1">2.爬坡不一定要抽車 <a class="header-anchor" href="#_2-爬坡不一定要抽車" aria-label="Permalink to &quot;2.爬坡不一定要抽車&quot;">​</a></h2><p>沿路會經過一些橋，上週騎的時候都會抽車<br> 這週就試著，壓低身體，退個三檔維持踏頻<br> 發現還是可以繼續維持高轉速爬上去</p><h2 id="下集預告" tabindex="-1">#下集預告 <a class="header-anchor" href="#下集預告" aria-label="Permalink to &quot;#下集預告&quot;">​</a></h2><p>網路上有人約騎 #那瑪夏<br> 會隔夜兩天，第一次跟團而且隔夜<br> 主要會是爬山，山上風景應該不錯<br> 回來再分享心得和照片</p>',12),m=t("div",{class:"embedly-responsive",style:{position:"relative","padding-bottom":"78.2227%",height:"0",overflow:"hidden"}},[t("iframe",{class:"embedly-embed",frameborder:"0",scrolling:"no",allowfullscreen:"",src:"https://cdn.embedly.com/widgets/media.html?src=https://www.relive.cc/view/v1vj48roJ6j/widget?r=embed-site&url=https://www.relive.cc/view/v1vj48roJ6j?r=embed-site&image=https://www.relive.cc/view/v1vj48roJ6j/png?x-ref=embed-site&key=f1631a41cb254ca5b035dc5747a5bd75&type=text/html&schema=relive",width:"1024",height:"801",style:{position:"absolute",top:"0",left:"0",width:"100%",height:"100%"}})],-1),l=[s,m];function o(p,f,b,_,h,d){return c(),a("div",null,l)}const k=r(e,[["render",o]]);export{n as __pageData,k as default};
